class WorldMap extends Component {
  constructor(props) {
    super(props);
    this.state = {
      grid: InitialGrid(),
      ticker: 0
    }
  }

  componentWillMount() {
    this.interval = setInterval(() => this.tick(), 1000)
    this.populateGrid();
  }

  tick() {
    this.setState({ticker: this.state.ticker +1})
    this.populateGrid();
  }

  populateGrid() {
    var populatedGrid =
    this.state.grid.map((row, rowIndex) => (
      row.map((cell, index) => {
          if (cell > 0 && this.checkNeighbours(rowIndex, index) && Math.random() < 0.5) {
            return cell*(-1);
          } else {
            return cell;
          }
      })
    ))
    this.setState({grid: populatedGrid})
  }

  checkNeighbours(row, col) {
    if (row === 0 || row === 119) {
      return false;
    } else if (
      this.state.grid[row-1][col-1] < 0 || 
      this.state.grid[row-1][col] < 0 ||
      this.state.grid[row-1][col+1] < 0 || 
      this.state.grid[row][col-1] < 0 ||
      this.state.grid[row][col+1] < 0 || 
      this.state.grid[row+1][col-1] < 0 ||
      this.state.grid[row+1][col] < 0 || 
      this.state.grid[row+1][col+1] < 0 
    ){
      return true;
    }
  }

  renderGrid() {
    return (
      this.state.grid.map((row, rowIndex) => (
        row.map((cell, index) => {
          if (typeof cell == 'number'){
            if (cell < 0) {
              return <Cell key={index} infected={true} land={cell}/>;
            } else {
              return <Cell key={index} infected={false} land={cell}/>;
            }
          } else {
            return <CityLink key={index} city={cell} active={this.checkNeighbours(rowIndex, index)}/>; 
          }
        })
      ))
    )
  }

  render() {
    return (
      <div>
        <h1>
          World Map
        </h1>
        <h2>{this.state.ticker}</h2>
        <div className="world-map">
          <div className="grid">
            {this.renderGrid()}
          </div>
        </div>
      </div>
    );
  }
}

export default WorldMap;



